import React from 'react';
import classes from './Posts.module.css';

const Posts = () => {
	return (
		<section className='posts'>
			<div className="posts__title">My posts</div>
			<div className="posts__items">
				<article className='item-post'>
					post1
				</article>
				<article className="item-post">
					post2
				</article>
				<article className="item-post">
					post3
				</article>
			</div>
		</section>
	)
}

export default Posts;
